private void initFromCaller()
{
    Args                            args = element.args();
    FormRun                         formRun;
    FormDataSource                  dataSource;
    BOBObjectView                   callerObjectView;
    AssetTable                      callerAssetTable;
    smmBusRelTable                  callerBusRelTable;
    InventDim                       callerInventDim;
    RORRentalLine                   callerRentalLine;
    RORRentalOrderLineView          callerRentalLineView;
    RORRentalFuelMgtView            callerRentalFuelMgtView;
    RORSubRentalOrderLineView       callerSubRentalOrderLineView;
    RORRentalQuotationOrderLineView callerRentalQuotationOrderLineView;
    WPPWorkOrderView                callerWorkOrderView;
    WPPWorkOrderLineListPageView    callerWorkOrderLineListPageView;
    BOBTmpObjectAvailability        callerTmpObjectAvailability;
    CustTable                       callerCustTable;
    VendTable                       callerVendTable;

    InventJournalTrans              inventJournalTrans;
    BOBRentalType                   rentalType;
    InventTable                     inventTable;

    QueryBuildDataSource            qbds;
    WMSOrderTrans                   callerWMSOrderTrans;
    boolean                         applyBlankValueFilter;

    if(args && args.caller() is FormRun)
    {
        //Add or clear ranges/links to caller record
        switch(args.dataset())
        {
            // when navigating from a fixed asset that's not linked to a business object,
            // open in grid view and remove the dynalink so all business objects are shown
            case tableNum(AssetTable):
                callerAssetTable = args.record();

                ObjectTable_q.dataSourceTable(tableNum(BOBObjectTable)).clearDynalinks();

                BOBObjectTable objectTableLoc = BOBObjectTable::findByAssetId(callerAssetTable.AssetId);

                if (objectTableLoc)
                {
                    ObjectTable_q.dataSourceTable(tableNum(BOBObjectTable))
                        .addRange(fieldNum(BOBObjectTable, ObjectId))
                        .value(objectTableLoc.ObjectId);
                }
                else
                {
                    applyBlankValueFilter = true;
                }
                break;

            // when navigating from a prospect that doesn't have any business objects
            // associated to it, remove the dynalink so all business objects are shown
            // Latest decision is to not to show any object if its not linked to a prospect
            case tableNum(smmBusRelTable):
                callerBusRelTable = args.record();

                if(!BOBObjectTable::existOrganizationParty(callerBusRelTable.Party))
                {
                    ObjectTable_q.dataSourceTable(tableNum(BOBObjectTable)).clearDynalinks();
                    applyBlankValueFilter = true;
                }
                break;

            case tableNum(SalesLine), tableNum(PurchLine), tableNum(SalesQuotationLine), tableNum(InventTransferLine):
                callerRentalLine = args.record();
                callerInventDim = InventDim::find(callerRentalLine.InventDimId);

                if(callerInventDim.inventSerialId)
                {
                    ObjectTable_q.dataSourceTable(tableNum(BOBObjectTable))
                        .addRange(fieldNum(BOBObjectTable, InventSerialId))
                        .value(callerInventDim.inventSerialId);
                }
                else if(callerRentalLine.BOBRentalTypeId
                     && callerRentalLine.ItemId
                     && InventTable::find(callerRentalLine.ItemId).BOBIsBulkRentalItem())
                {
                    ObjectTable_q.dataSourceTable(tableNum(BOBObjectTable))
                        .addRange(fieldNum(BOBObjectTable, RentalTypeId))
                        .value(callerRentalLine.BOBRentalTypeId);
                }
                else
                {
                    applyBlankValueFilter = true;
                }
                break;

            case tableNum(RORRentalOrderLineView):
                callerRentalLineView = args.record();

                if(callerRentalLineView.inventSerialId)
                {
                    ObjectTable_q.dataSourceTable(tableNum(BOBObjectTable))
                        .addRange(fieldNum(BOBObjectTable, InventSerialId))
                        .value(callerRentalLineView.inventSerialId);
                }
                else if(callerRentalLineView.BOBRentalTypeIdRequested
                     && callerRentalLineView.ItemId
                     && InventTable::find(callerRentalLineView.ItemId).BOBIsBulkRentalItem())
                {
                    ObjectTable_q.dataSourceTable(tableNum(BOBObjectTable))
                        .addRange(fieldNum(BOBObjectTable, RentalTypeId))
                        .value(callerRentalLineView.BOBRentalTypeIdRequested);
                }
                else
                {
                    applyBlankValueFilter = true;
                }
                break;

            case tableNum(RORRentalFuelMgtView):
                callerRentalFuelMgtView = args.record();

                if(callerRentalFuelMgtView.InventSerialId)
                {
                    ObjectTable_q.dataSourceTable(tableNum(BOBObjectTable))
                        .addRange(fieldNum(BOBObjectTable, InventSerialId))
                        .value(callerRentalFuelMgtView.InventSerialId);
                }
                else
                {
                    applyBlankValueFilter = true;
                }
                break;

            case tableNum(RORSubRentalOrderLineView):
                callerSubRentalOrderLineView = args.record();

                if (callerSubRentalOrderLineView.inventSerialId)
                {
                    ObjectTable_q.dataSourceTable(tableNum(BOBObjectTable))
                        .addRange(fieldNum(BOBObjectTable, InventSerialId))
                        .value(callerSubRentalOrderLineView.inventSerialId);
                }
                else
                {
                    applyBlankValueFilter = true;
                }
                break;

            case tableNum(RORRentalQuotationOrderLineView):
                callerRentalQuotationOrderLineView = args.record();

                if (callerRentalQuotationOrderLineView.inventSerialId)
                {
                    ObjectTable_q.dataSourceTable(tableNum(BOBObjectTable))
                        .addRange(fieldNum(BOBObjectTable, InventSerialId))
                        .value(callerRentalQuotationOrderLineView.inventSerialId);
                }
                else
                {
                    applyBlankValueFilter = true;
                }
                break;

            case tableNum(WPPWorkOrderView):
                callerWorkOrderView = args.record();

                if (callerWorkOrderView.BOBObjectTableRecId)
                {
                    ObjectTable_q.dataSourceTable(tableNum(BOBObjectTable)).clearDynalinks();
                    ObjectTable_ds.query().dataSourceTable(tableNum(BOBObjectTable))
                        .addRange(fieldNum(BOBObjectTable, RecId))
                        .value(SysQuery::value(callerWorkOrderView.BOBObjectTableRecId));
                }
                else
                {
                    applyBlankValueFilter = true;
                }
                break;

            case tableNum(WPPWorkOrderLineListPageView):
                callerWorkOrderLineListPageView = args.record();

                if (callerWorkOrderLineListPageView.BOBObjectTableRecId)
                {
                    ObjectTable_q.dataSourceTable(tableNum(BOBObjectTable)).clearDynalinks();
                    ObjectTable_ds.query().dataSourceTable(tableNum(BOBObjectTable))
                        .addRange(fieldNum(BOBObjectTable, RecId))
                        .value(SysQuery::value(callerWorkOrderLineListPageView.BOBObjectTableRecId));
                }
                else
                {
                    applyBlankValueFilter = true;
                }
                break;

            case tableNum(BOBObjectView):
                callerObjectView = args.record();

                ObjectTable_q.dataSourceTable(tableNum(BOBObjectTable)).clearDynalinks();
                ObjectTable_ds.query().dataSourceTable(tableNum(BOBObjectTable))
                    .addRange(fieldNum(BOBObjectTable, ObjectId))
                    .value(callerObjectView.ObjectId);
                break;

            case tableNum(BOBTmpObjectAvailability):
                callerTmpObjectAvailability = args.record();

                ObjectTable_q.dataSourceTable(tableNum(BOBObjectTable)).clearDynalinks();
                ObjectTable_ds.query().dataSourceTable(tableNum(BOBObjectTable))
                    .addRange(fieldNum(BOBObjectTable, InventSerialId))
                    .value(callerTmpObjectAvailability.InventSerialId);
                break;

            case tableNum(InventJournalTrans):
                inventJournalTrans = args.record();
                callerInventDim     = inventJournalTrans.inventDim();
                rentalType          = BOBRentalType::findFromItemId(inventJournalTrans.ItemId);

                if(rentalType
                && rentalType.Classification == BOBRentalTypeClassification::Serialized
                && callerInventDim.inventSerialId
                && BOBObjectTable::findInventSerialId(callerInventDim.inventSerialId).RecId != 0)
                {
                    ObjectTable_ds.queryBuildDataSource().addRange(fieldNum(BOBObjectTable, InventSerialId)).value(callerInventDim.inventSerialId);
                }
                else if(rentalType.Classification == BOBRentalTypeClassification::Bulk)
                {
                    select firstOnly ObjectId from callerObjectView
                    where !callerObjectView.InventSerialId
                    &&    callerObjectView.RentalTypeId == rentalType.RentalTypeId;

                    ObjectTable_ds.queryBuildDataSource().addRange(fieldNum(BOBObjectTable, ObjectId)).value(callerObjectView.ObjectId);
                }
                else
                {
                    applyBlankValueFilter = true;
                }
                break;

            case tableNum(WMSOrderTrans):
                callerWMSOrderTrans = args.record();
                callerInventDim     = callerWMSOrderTrans.inventDim();
                rentalType          = BOBRentalType::findFromItemId(callerWMSOrderTrans.ItemId);

                if(rentalType
                && rentalType.Classification == BOBRentalTypeClassification::Serialized
                && callerInventDim.inventSerialId
                && BOBObjectTable::findInventSerialId(callerInventDim.inventSerialId).RecId != 0)
                {
                    ObjectTable_ds.queryBuildDataSource().addRange(fieldNum(BOBObjectTable, InventSerialId)).value(callerInventDim.inventSerialId);
                    ObjectTable_ds.executeQuery();
                }
                else if(rentalType.Classification == BOBRentalTypeClassification::Bulk)
                {
                    select firstOnly ObjectId from callerObjectView
                    where !callerObjectView.InventSerialId
                    &&    callerObjectView.RentalTypeId == rentalType.RentalTypeId;

                    ObjectTable_ds.queryBuildDataSource().addRange(fieldNum(BOBObjectTable, ObjectId)).value(callerObjectView.ObjectId);
                }
                else
                {
                    applyBlankValueFilter = true;
                }
                break;

            case tableNum(CustTable):
                callerCustTable = element.args().record();
                ObjectTable_ds.queryBuildDataSource().addRange(fieldNum(BOBObjectTable, OrganizationParty)).value(queryValue(callerCustTable.Party));
                break;

            case tableNum(VendTable):
                callerVendTable = element.args().record();
                ObjectTable_ds.queryBuildDataSource().addRange(fieldNum(BOBObjectTable, OrganizationParty)).value(queryValue(callerVendTable.Party));
                break;
        }

        if (applyBlankValueFilter)
        {
            ObjectTable_q.dataSourceTable(tableNum(BOBObjectTable))
                        .addRange(fieldNum(BOBObjectTable, ObjectId))
                        .value(SysQuery::valueEmptyString());
        }
    }
}

public void run()
{
    //initFromCaller is moved before super() to let this method add ranges or joins to the BO datasource.
    //This improves performance as it would only fetch the filtered record based on caller, instead of fetching all and then 
    //refetching with filter or join.
    element.initFromCaller();

    super();
}

public void init()
{
    super();

    if (element.args().parmEnumType() == enumNum(BOBObjectTableListPage))
    {
        QueryBuildRange qbrCategory = this.queryBuildDataSource().addRange(fieldNum(BOBObjectTable, Category));

        switch(element.args().parmEnum())
        {
            case BOBObjectTableListPage::Rental,
                 BOBObjectTableListPage::External:
                qbrCategory.value(queryValue(element.args().parmEnum()));
                break;

            case BOBObjectTableListPage::Bulk:
                QueryBuildDataSource qbdsRentalType = this.queryBuildDataSource().addDataSource(tableNum(BOBRentalType));
                qbdsRentalType.addLink(fieldNum(BOBObjectTable, RentalTypeId), fieldNum(BOBRentalType, RentalTypeId));
                qbdsRentalType.joinMode(JoinMode::ExistsJoin);
                qbdsRentalType.addRange(fieldNum(BOBRentalType, Classification)).value(SysQuery::value(BOBRentalTypeClassification::Bulk));
                break;
        }
    }


    this.cacheAddMethod(tableMethodStr(BOBObjectTable, BSADisplayActiveContractId));
    this.cacheAddMethod(tableMethodStr(BOBObjectTable, BSADisplayActiveContractDescription));
    this.cacheAddMethod(tableMethodStr(BOBObjectTable, displayWarning));
}

public void updateDesign()
{
    BOBRentalType   rentalType;
    boolean         isBulk;
    boolean         isExternalOrSubRental;
    boolean         isInternalOrExternal;
    boolean         onRentDatesOK;
    boolean         isPendingOrRentalOrInternal;
    boolean         isSerialized;
    ;

    rentalType              = objectTable.rentalType();
    isBulk                  = (rentalType.Classification == BOBRentalTypeClassification::Bulk);
    isExternalOrSubRental   = (objectTable.Category == BOBObjectCategory::External || objectTable.Category == BOBObjectCategory::SubRental);
    isInternalOrExternal    = (objectView.Category == BOBObjectCategory::Internal || objectView.Category == BOBObjectCategory::External);
    onRentDatesOK           = ((objectView.FirstOnRentDate &&  objectView.LastOnRentDate) || (!objectView.FirstOnRentDate && !objectView.LastOnRentDate));
    isSerialized            = (rentalType.Classification == BOBRentalTypeClassification::Serialized);
    isPendingOrRentalOrInternal = ((objectView.Category == BOBObjectCategory::Pending || objectView.Category == BOBObjectCategory::Internal || objectView.Category == BOBObjectCategory::Rental));
    this.allowDelete(!objectView.FirstOnRentDate && !objectView.LastOnRentDate);

    ChangeLocationButton.enabled(!isBulk);
    ChangeOwnerButton.enabled((!objectView.Depot || objectView.DepotEndDate) && onRentDatesOK && !isBulk);
    ChangeAvailabilityButton.enabled(!isBulk);
    ChangeDatesButton.enabled(!isInternalOrExternal && !isBulk);
    ChangeRentalTypeButton.enabled(!isBulk);
    ChangeDepotButton.enabled(!isInternalOrExternal && objectView.PhysicalOwner && objectView.FirstOnRentDate && !isBulk);
    ChangeOrganizationPartyButton.enabled(isExternalOrSubRental && !isBulk);
    ChangeFleetNum.enabled(isPendingOrRentalOrInternal && isSerialized);
    BOBRentalInventOnHand.enabled(BOBPostingPolicy::findRecId(rentalType.PostingPolicyRecId).IncludeInAvailabilityOverview);

    ObjectTable_ds.object(fieldNum(BOBObjectTable, ExternalObjectId)).enabled(objectTable.Category == BOBObjectCategory::External);
}

public int active()
{
    int ret;

    ret = super();

    this.updateDesign();

    return ret;
}

public void research(boolean _retainPosition = false)
{
    if(_retainPosition) // for some reason the call to super is unable to retain the current record, even if _retainPosition is true
    {
        element.args().lookupRecord(ObjectTable);
    }

    super(_retainPosition); 
}

public void init()
{
    super();

    this.query().dataSourceTable(tableNum(BOBObjectView)).addLink(fieldNum(BOBObjectTable, ObjectId),
                                                                  fieldNum(BOBObjectView, ObjectId),
                                                                  ObjectTable_ds.name());
}

public void tabChanged(int _FromTab, int _ToTab)
{
    super(_FromTab, _ToTab);

    element.task(#tabChanged);
}
